import "./OtherOne.scss"

import Preview from "../../assets/images/Upload-video-preview.jpg";

function OtherOne(props) {
    const { title, channel} = props;

    return (
        <article className='other__one'>
            <img className='other__one-preview' src={Preview} alt="Next Video Preview" />
            <div className='other__one-text'>
                <h4 className='other__one-text-title'>{title}n</h4>
                <p className='other__one-text-creator'>{channel}</p>
            </div>
        </article>
    );
}

OtherOne.propTypes = {
    title: PropTypes.string.isRequired,
    channel: PropTypes.string.isRequired,
    image: PropTypes.string.isRequired,
};

export default OtherOne;
